import React from 'react'
import { Form, Input, Row ,Button} from 'antd'

class RegiterComponent extends React.Component {

    constructor() {
        super()
        this.state = {

        }
    }

    FormFinish = (e) => {
        console.log(e)
    }
    render() {
        return (
            <Row justify="center">
                <Form
                    onFinish={this.FormFinish}
                >
                    <Form.Item
                        label="USER"
                        name="user"
                    >
                        <Input />
                    </Form.Item>
                    <Form.Item >
                        <Button type="primary" htmlType="submit">
                            {'Submit'}
                        </Button>
                    </Form.Item>
                </Form>
            </Row>
        )
    }
}

export default RegiterComponent
